import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { MpacientesPageRoutingModule } from './mpacientes-routing.module';

import { MpacientesPage } from './mpacientes.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    MpacientesPageRoutingModule
  ],
  declarations: [MpacientesPage]
})
export class MpacientesPageModule {}
